import { useRemoteNewsTop } from "../hooks/remoteHooks";
import CarouselDateNews from "../components/CarouselDateNews";
import News from "../components/News";

function NewsTop() {
  const [topNews, setTopNews] = useRemoteNewsTop();

  return (
    <>
      <CarouselDateNews />
      <UsersTop></UsersTop>
      <div>
        {topNews.map((news) => (
          <News key={news.id} noticias={news} setTopNews={setTopNews}></News>
        ))}
      </div>
    </>
  );
}

export default NewsTop;
